    counter = [0, 0, 0]
    for bill in bills:
        if bill == 25:
            counter[0] += 1
        elif bill == 50:
            if counter[0] < 1:
                return 'NO'
            counter[0] -= 1
            counter[1] += 1
        elif bill == 100:
            if counter[1] > 0 and counter[0] > 0:
                counter[1] -= 1
                counter[0] -= 1
            elif counter[0] >= 3:
                counter[0] -= 3
            else:
                return 'NO'
    return ''

